import './navbar.css';

const Navbar = () => {
  return (
    <div className='navbar bg-light '>
      <div className='logo'>
        <a href='/'>Logo</a>
      </div>

      <div className='links'>
        <a href='/'>Home</a>
        <a href='/contact'>Contact</a>
      </div>
    </div>
  );
};

export default Navbar;
